import React from 'react';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import ProductsSection from './components/ProductsSection';
import WhyChooseUs from './components/WhyChooseUs';
import RecipesSection from './components/RecipesSection';
import TestimonialsSection from './components/TestimonialsSection';
import Footer from './components/Footer';
import FarmPracticesSection from './components/FarmPracticesSection';
import A2MilkSection from './components/A2MilkSection';
import OurCowsSection from './components/OurCowsSection';
import WeCareSection from './components/WeCareSection';
import CareersSection from './components/CareersSection';
import ChatbotWidget from './components/ChatbotWidget';
import OrderTrackingDemo from './components/OrderTrackingDemo';

function App() {
  return (
    <div className="App">
      <Navbar />
      <main>
        <Hero />
        <ProductsSection />
        <WhyChooseUs />
        <FarmPracticesSection />
        <A2MilkSection />
        <OurCowsSection />
        <WeCareSection />
        <CareersSection />
        <RecipesSection />
        <TestimonialsSection />
      </main>
      <Footer />
      <OrderTrackingDemo />
      <ChatbotWidget />
    </div>
  );
}

export default App;
